import React from "react";
import { Todo } from "./Main";

interface TodoList {
  todos: Todo[];
  onTodoChange: (item: Todo) => void;
  onDelete: (item: Todo) => void;
}

const ListDetail = ({ todos, onTodoChange, onDelete }) => {
  return (
    <div>
      {todos.map((item, i) => (
        <div key={i}>
          <input
            type="checkbox"
            checked={item.completed}
            onChange={() => onTodoChange(item)}
          />
          <span>{item.data}</span>
          <button onClick={() => onDelete(item)}>X</button>
        </div>
      ))}
    </div>
  );
};

export default ListDetail;
